import React from 'react'
import { FaSpotify } from 'react-icons/fa'

export const Sidebar = () => {
    return (
        <div className='h-screen fixed w-[10rem] bg-spotify-green'>
            <FaSpotify className='w-full' />
        </div>
    )
}
